subSubSection.paragraph:
Head shield smooth. Frontal margin with strong median notch; posterior margin transverse or weakly concave; border slightly wider posterolaterally than medially. Median furrow incised for about 1/6 length to transverse suture, shallow throughout. Antennal length 4.1–5.7 times width of head shield, usually extending back to tergite 5 (
Fig. 7A
); 33–40 articles, majority of specimens examined with 36; basal two articles much larger than succeeding two; relatively gradual change in length of articles along rest of antenna (
Fig. 10G,H
), articles 3 to 8–10 typically wider than long, gradually elongating along antenna with more distal articles up to twice as long as wide (
Fig. 10I
); gradational increase in density of setae to about tenth article, then more or less constant. Ocellus moderately large, overhanging lateral margin of head (
Fig. 9A
), usually translucent, sometimes whitish to dark purple, domed. Tömösváry organ small, deep, longitudinally elliptical, outer edge at anterolateral margin of cephalic pleurite (
Fig. 9D–F
).

