subSubSection.paragraph:
Small transverse seta projects medially from pit in labral sidepiece (
Fig. 9C
). Labral margin with rounded shoulder beside midpiece, with pronounced break in curvature where branching bristles overhang margin; fringe composed of up to 30 densely grouped bristles with many short, spinelike projections along their length, a few longer spines at distal end (
Fig. 9G
).

