subSubSection.paragraph:
Maxillipede coxosternum trapezoidal to subsemicircular, dental margin broad, each half weakly convex (
Fig. 9H–K
); median notch lacking; teeth moderately large, triangular projections, invariably 3+3, usually with a slightly wider space between the outer tooth and middle tooth (
Fig. 9K
) but ranging from equidistant to space between outer and middle tooth nearly twice that between inner and middle tooth. Coxosternum bearing moderate number of large, scattered setae, usually with distinctly denser setation behind dental margin and anterolaterally (
Fig. 9I,K
). Tarsungulum with long, slender pretarsal section, as much as twice length of tarsal section (
Fig. 9H,L
). Setae on telopodite somewhat more abundant on inner part of femur, tibia and tarsal section of tarsungulum than on outer part, these setae moderately long.

Mandible: Four paired teeth on right mandible, left with smaller flattened fifth tooth adjacent to furry pad (
Fig. 10A,B
). Approximately 20 aciculae differentiated into two rows (
Fig. 10C,D
); aciculae in dorsal part of outer row with pronounced serrations on both margins along distal half, those in ventral part of outer row with a simple margin or with weak scalloping distally; aciculae of inner row with simple margin (
Fig. 10C,D
). Fringe of branching bristles skirts aciculae, with transition to rows of scales with multifurcating spine fringes adjacent to midpoint of the second most ventral tooth; scales gradually shortening dorsally (
Fig. 10F
) to terminate before reaching furry pad (
Fig. 10K
); ventralmost bristles in fringe narrow-based, lacking spine-like projections on basal sixth to eighth of bristle, spine-like projections abundant and even along remainder of bristle (
Fig. 10E
); bristles branching into a few spines distally. Accessory denticle field without grooves between rows of denticles or at margin of denticle field (
Fig. 10A,F
); largest accessory denticles bluntly conical, grading into smaller triangular denticles then small elongate rods near fringe of scale-like bristles; band of unsculpted cuticle on dorsalmost tooth separates accessory denticles from furry pad; furry pad with many elongate, simple bristles (
Fig. 10K
), some bristles with bifid terminations.

First maxilla: Minute wedge-shaped sternite (
Fig. 10L
). Coxal process trapezoidal, with a few plumose setae and up to 10 simple setae on anteromedial edge (
Fig. 10J
), this cluster slightly separated from a few simple setae on inner edge of coxal process; plumose setae with numerous short, spine-like branches along their distal third. Cluster of about six barb-like sensilla microtrichoidea on posterolateral part of coxal process (
Fig. 10J
). Distal article of telopodite with two rows of about 15 plumose setae along inner margin; branches developed along distal half of these setae (
Fig. 10M
); shorter simple setae on membranous strip alongside inner margin; main field of distal article of telopodite bearing a few setae anteriorly.

Second maxilla: Sternite small, fused with coxae. Band of 8–11 short setae along anterior part of coxa. Tarsus bearing numerous simple setae on outer surface, cluster of many plumose setae on membranous patch on inner surface (
Fig. 11D,E
); branches on plumose setae mostly confined to distal half. Claw small, composed of five digits, median digit long, thick, with shorter, slender digit between median and each outer digit (
Fig. 11E
).

Tergites weakly wrinkled. T1 generally trapeziform, smaller than T3, slightly narrower than head shield (
Fig. 7A
), about 70% width of widest tergite (T8), posterior angles rounded, posterior margin transverse; lateral margins subparallel in T3, slightly convex in T5, posterior angles rounded in both, posterior margin faintly concave in TT3 and 5; TT1 and 3 bordered posteriorly; borders of TT5 and 7 incomplete posteriorly; posterior margin of T7 with transverse or convex medial sector, having independent curvature from lateral sectors, posterior angles gently triangular, rounded; lateral margins of TT4–14 convex, all bordered laterally; posterior margin of T8 weakly concave, posterior angle blunt, TT10 and 12 posterior margins gently concave, posterior angles with obtuse, blunt corners; TT6, 9, 11 and 13 embayed with transverse posteromedial third, posterior angle of T6 rounded, T9 blunt, TT11 and 13 with sharp triangular projections; posterior margin of T14 concave, with blunt posterior angles.

