subSubSection.paragraph:
Legs: Strong, pointed distal projections with sclerotized tips on tibiae of legs 1–14. Prefemur of legs 1–13 with short to moderate setae scattered on anterior and posterior faces, some longer, thicker setae on ventral edge of prefemur, femur and tibia; longest setae on femur and tibia equal to (
Fig. 8B
) or shorter than (
Fig. 8A
) longest on prefemur; a few thickened setae encircling distal margin of femur; strong, pigmented seta at ventrodistal end of tibia on anterior face of legs 1–13; tarsus with combination of slender setae of fairly even length, and four pairs of thicker, divergent, pigmented setae on ventral side of legs 1–13 (
Fig. 11K
), two of these just proximal to articulations between tarsomeres, one near midlength of distal tarsomere. Setae on legs 14 and 15 more uniformly slender and sparsely distributed than on preceding legs, especially sparse on tibia and basitarsus of leg 15. Three tarsomeres in legs 1–12 (
Fig. 8A
), with divided basitarsus. Condyle at joint between basitarsus and distitarsus on legs 13–15 only. Four tarsomeres in legs 13 and 14, basitarsus and distitarsus with two parts each (
Figs. 8B,C
, 
11I
); proximal tarsomere nearly 70% length of basitarsus and 55–60% length of distitarsus on leg 14. Leg 15 with five tarsomeres, basitarsus having two, distitarsus three (
Figs. 8D
, 
11H
). Distitarsus 70–80% length of basitarsus on leg 15; basitarsus 12–14 times longer than broad; proximal tarsomere 55–65% length of basitarsus; three tarsomeres comprise about 45–50, 15–20 and 30–40% (proximal to distal) length of distitarsus. Pretarsal claws (
Fig. 11F,G
) as described below for 

H. milledgei

.

