subSubSection.paragraph:
Coxal pores round or ovate (
Fig. 7B,C
), commonly 5,6,6,6/5,6,6,6 in large males and females, males maximum 5,6,6,6/5,6,6,6, minimum 3,4,4,4/3,4,4,4; females maximum 7,7,7,7/7,7,7,7, minimum 3,4,5,5/3,4,5,5. Coxal pore field set in shallow groove, distal pore(s) partly concealed by anteroventral face of coxa. Anal pores large in both sexes.

Female (
Fig. 7B
): Sternite of segment 15 transverse or convex posteromedially. Tergites of first genital segment and telson usually well sclerotized. Sternite of first genital segment large, posterior margin concave between condyles of gonopods except for small median projection, posterior two-thirds fairly evenly scattered with setae of varied length; short setae concentrated in a band along posteromedial margin.First article of gonopod bearing two (three in 
one specimen
) large, bullet-shaped spurs, inner spur slightly smaller than outer; spurs gently curved such that tip points up (
Fig. 11C,J
); first and second articles of gonopod with mix of many short, moderate and long setae, up to 56 on first article, up to 37 on second; third article with up to 10 setae, mostly moderate, one or two long ones (
Fig. 11J
). Claw large, undivided.

Male (
Fig. 7C
): Sternite of segment 15 rounded posteriorly. Sternite of first genital segment small, divided, with transverse posterior margin, bearing numerous moderately long setae, short setae concentrated in a band near posterior margin (
Fig. 11B
). Gonopod of three articles and tapering, seta-like terminal process that bears many short spine-like projections (
Fig. 11A
), the three articles each bearing numerous short to moderately long setae, typically about 15, 10–12 and 10 for first to third articles, respectively; extended penis approximately equal in length to first article of gonopod.
